Scripts.OnEnter:
GameTooltip:SetOwner( this, "ANCHOR_LEFT" );
GameTooltip:AddLine( "|cFFFF0000MAKE SURE YOU WANT TO DELETE!|r" );
GameTooltip:Show();

Scripts.OnClick:
if(ObjectNumber:GetNumLetters() < 1) then
ShowMessage("Specify an Object Number!", "FF0000", 1);
else
PlaceObject();
ObjectNumber:ClearFocus();
end

Scripts.OnEnter:
GameTooltip:SetOwner( this, "ANCHOR_LEFT" );
GameTooltip:AddLine( "|cFFFF0000MAKE SURE THE OBJECT SCALE IS WHAT YOU WANT IT TO BE BEFORE USING THIS BUTTON!|r" );
GameTooltip:Show();

Scripts.OnClick:
if ObjectNumber:GetNumLetters() < 1 then
GMH_EmptyField()
else
ObjectScale();
ObjectNumber:ClearFocus();
end

if ObjectNumber:GetNumLetters() < 1 then
GMH_EmptyField()
else
LookupObject();
ObjectNumber:ClearFocus();
end
